(25, 'listing-1.jpg', 'Top 5 Locations for Real Estate Investment in Thane', 'Real estate', 'Admin', '<p style=\"text-align:center\"><span style=\"font-size:16px\">&nbsp; <strong>RERA &amp; GST</strong>&nbsp; &nbsp; </span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;<strong><span style=\"color:#c0392b\">The driving factors of the present Real Estate market are by far - RERA &amp; GST which have also helped Home Buyers regain confidence and reaffirm promises by bringing huge amount of transparency into the unorganized sector. Home Buying is more aligned towards sentiment when compared with mathematical analytics and RERA, GST have been successful in uplifting the buyer sentiment. </span></strong></p>\r\n\r\n<ul>\r\n	<li style=\"text-align: justify;\">&nbsp; &nbsp; &nbsp; We have already been monitoring the increase in supply/demand ratio since the era of demonetization / RERA &amp; GST began. We had also monitored most of the Home buyers who had been waiting for <em><strong>RERA </strong></em>to come into full-force. And since RERA has been implemented in most regions with affirmed powers and planned implementation, buyers are all set to open doors of their dreams this season.&nbsp;&nbsp;<strong><a href=\"http://sarestates.in/\">http://sarestates.in/</a></strong></li>\r\n	<li style=\"text-align: justify;\">&nbsp; &nbsp; &nbsp;<u>RERA has injected</u> the assurance and confidence into the Realty Business and developers are all set to en-cash the same this festive season by introducing never before offers and push the sales figures to a new high compared to the last festive season which was not an impressive one. RBI has also taken positive steps by cutting repo rates which was also awaited by the sector.</li>\r\n</ul>\r\n', '2020-05-06'),
(28, 'Lighthouse.jpg', 'A Guide for All Women Home Buyers in India', 'real estate', 'admin', 'Thane is a metropolitan city in Maharashtra. In last few years; People are migrating in Thane for various reasons. Thane has emerged in Real Estate industry rapidly. Thane is an instant neighbor of Mumbai & also part of MMR.\r\nThane has all the transportat', '2020-05-06'),
(29, 'image_5.jpg', 'BANGALORE: CITY OF AFFORDABLE HOUSES', 'real estate', 'Admin', '<p style=\"margin-left:40px; text-align:justify\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<span style=\"color:#3498db\"> &nbsp; &nbsp;Thane is a metropolitan city in Maharashtra. In last few years; People are migrating in Thane for various reasons. Thane has emerged in Real Estate industry rapidly. Thane is an instant neighbor of Mumbai &amp; also part of MMR. Thane has all the transportation facilities available right from the bus, train, auto to Metro. Metro is in under construction stage in Thane which will have connectivity to all the major parts of Mumbai. As compare to Mumbai the climate of thane is good for health. As per the survey Thane is lowest in air, water &amp; noise pollution. Here is the list of top 5 places to invest in Thane:</span> 1. <strong>Manpada: Manpada has a great locality. </strong></p>\r\n\r\n<p style=\"margin-left:40px; text-align:justify\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;The connectivity &amp; infrastructure makes it a prime location for people. 2. Ghodbunder Road: Ghodbunder Road is rapidly developing area in Thane. The area is combined with affordable houses with all the luxurious amenities. 3. Balkum: Balkum is one of the preferred destinations for homebuyers. It is easily accessible, peaceful &amp; nature friendly area. It will be premium residential hub soon. 4. Kapurbawdi: Kapurbawdi have varied of residential projects one can choose from. It is a favorable residence for the people. 5. Majiwada: The locality is suitable for regular traveler. The location is occupied of finest residential projects along with all the essential amenities.</p>\r\n', '2020-05-06'),
(30, 'pexels-photo-164522.jpeg', 'Top 5 Locations for Real Estate Investment in Thane', 'real estate', 'admin', 'Thane is a metropolitan city in Maharashtra. In last few years; People are migrating in Thane for various reasons. Thane has emerged in Real Estate industry rapidly. Thane is an instant neighbor of Mumbai & also part of MMR. Thane has all the transportation facilities available right from the bus, train, auto to Metro. Metro is in under construction stage in Thane which will have connectivity to all the major parts of Mumbai. As compare to Mumbai the climate of thane is good for health. As per the survey Thane is lowest in air, water & noise pollution. Here is the list of top 5 places to invest in Thane: 1. Manpada: Manpada has a great locality. The connectivity & infrastructure makes it a prime location for people. 2. Ghodbunder Road: Ghodbunder Road is rapidly developing area in Thane. The area is combined with affordable houses with all the luxurious amenities. 3. Balkum: Balkum is one of the preferred destinations for homebuyers. It is easily accessible, peaceful & nature friendly area. It will be premium residential hub soon. 4. Kapurbawdi: Kapurbawdi have varied of residential projects one can choose from. It is a favorable residence for the people. 5. Majiwada: The locality is suitable for regular traveler. The location is occupied of finest residential projects along with all the essential amenities.', '2020-05-06'),
(66, 'blog4.png', 'BANGALORE: CITY OF AFFORDABLE HOUSES', 'Investment', 'Admin', 'The driving factors of the present Real Estate market are by far - RERA & GST which have also helped Home Buyers regain confidence and reaffirm promises by bringing huge amount of transparency into the unorganized sector. Home Buying is more aligned towards sentiment when compared with mathematical analytics and RERA, GST have been successful in uplifting the buyer sentiment.\r\n\r\nWe have already been monitoring the increase in supply/demand ratio since the era of demonetization / RERA & GST began. We had also monitored most of the Home buyers who had been waiting for RERA to come into full-force. And since RERA has been implemented in most regions with affirmed powers and planned implementation, buyers are all set to open doors of their dreams this season.\r\n\r\nRERA has injected the assurance and confidence into the Realty Business and developers are all set to en-cash the same this festive season by introducing never before offers and push the sales figures to a new high compared to the last festive season which was not an impressive one.\r\n\r\nRBI has also taken positive steps by cutting repo rates which was also awaited by the sector.', '2020-05-06'),
