(76, 'bg_2.jpg', 'BANGALORE: CITY OF AFFORDABLE HOUSES', 'Real estate', 'Admin', '<p style=\"text-align:center\"><span style=\"color:#8e44ad\">&nbsp;<strong>RERA &amp; GST</strong>&nbsp; &nbsp;</span></p>\r\n\r\n<p><span style=\"color:#c0392b\">&nbsp;</span><strong><span style=\"color:#c0392b\"><em>The driving factors of the present Real Estate market are by far - RERA &amp; GST which have also helped Home Buyers regain confidence and reaffirm promises by bringing huge amount of transparency into the unorganized sector.</em>&nbsp;</span>Home Buying is more aligned towards sentiment when compared with mathematical analytics and RERA, GST have been successful in uplifting the buyer sentiment.</strong></p>\r\n\r\n<ul>\r\n	<li>&nbsp; &nbsp; &nbsp; We have already been monitoring the increase in supply/demand ratio since the era of demonetization / RERA &amp; GST began. We had also monitored most of the Home buyers who had been waiting for&nbsp;<em><strong>RERA&nbsp;</strong></em>to come into full-force. And since RERA has been implemented in most regions with affirmed powers and planned implementation, buyers are all set to open doors of their dreams this season.&nbsp;&nbsp;<strong><a href=\"http://sarestates.in/\">http://sarestates.in/</a></strong></li>\r\n	<li>&nbsp; &nbsp; &nbsp;<u>RERA has injected</u>&nbsp;the assurance and confidence into the Realty Business and developers are all set to en-cash the same this festive season by introducing never before offers and push the sales figures to a new high compared to the last festive season which was not an impressive one. RBI has also taken positive steps by cutting repo rates which was also awaited by the sector.</li>\r\n</ul>\r\n', '2020-05-20');

